Az ötcenteseket $x$-et jelölve, az ezeknek a számoknak a számára pedig $10x$-et, az ezeknek a számoknak a számára pedig $20x$-et adja. A feladatban az $x+20x=75$ egyenletet adja meg, melynek megoldása $x=3$. Az ötcenteseknek tehát 3-ek van.  \[
\boxed{3}
\]

A számoknak a radikális konjugáltjai egymás után van van, azaz $5+\sqrt{3}$ és $5-\sqrt{3}$. A szorzatuk:
\begin{align*}
(5+\sqrt{3})(5-\sqrt{3}) &= 5\cdot 5 + 5\cdot (-\sqrt{3}) + \sqrt{3}\cdot 5 + \sqrt{3}\cdot (-\sqrt{3}) \\
&= 25 - 3 = \boxed{22}.
\end{align*}

A sorozatban az $2n-1$ tagja van. Ha a tagja $2003$, akkor $2n-1=2003$, amiből $n=1002$. A tagja $1002$-et az 1002. tag.  \[
\boxed{1002}
\]

Az $a$, $a+1$ és $a+2$ egymást követő egész számok szorzata $a(a+1)(a+2)=120$. A 120 számrendszerben 120=2$\cdot$2$\cdot$2$\cdot$3$\cdot$5. A számok egymást követőek, ezért az 120 számot 3-est oszthatunk. A 2$\cdot$2$\cdot$2 osztva az 8, a 3 osztva a 3, a 5 osztva a 5. A számok 8, 9 és 10. A számok átlaga $\frac{8+9+10}{3}=9$, amelynek 24-ellegetett kettőt adja meg. A legnagyobb a 10.  \[
\boxed{10}
\]
